import React from "react";
import MyHeader from "./components/MyHeader";
import MyFooter from "./components/MyFooter";
import Info from "./components/Info";
function Start() {
  return (
    <div className="container">
      <MyHeader />
      <Content>
        <Info />
      </Content>
      <MyFooter />
    </div>
  );
}

export default Start;
